import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => {
  return (
    <div className="navigation">
      <div className="navbar navbar_type_desktop"></div>
      <div class="hamburger-menu">
        <input id="menu__toggle" type="checkbox" />
        <label class="menu__btn" for="menu__toggle">
          <span></span>
        </label>

        <ul class="menu__box">
          <li>
            <Link className="navbar__link navbar__link-signin" to="/sign-in">
              Фильмы
            </Link>
          </li>
          <li>
            <Link className="navbar__link navbar__link-signup" to="/sign-up">
              Сохраненные фильмы
            </Link>
          </li>
          <button className="navbar__button">Аккаунт</button>
        </ul>
      </div>
    </div>
  );
};

export default Navigation;
